import React, { Component } from 'react'

export class Question extends Component {
  render() {
    return (
        <div className="question">
            <input type="radio" className="question1" name="question1" value="1" />
            <input type="radio" className="question1" name="question1" value="2" />
            <input type="radio" className="question1" name="question1" value="3" />
            <input type="radio" className="question1" name="question0" value="4" />
            <input type="radio" className="question1" name="question0" value="5" />
        </div>
    )
  }
}

export default Question
